import React from 'react';
import {Button, Grid} from '@material-ui/core';

const MensDetails = ({classes, index}) => {
    return <Grid container item xs={12} spacing={4} className={classes.gridCss} justify='center'>
				<Grid item xs={12} className={classes.contentCss}>{index === 1 ? 'Ubran Style' : "Men's Casusal"}</Grid>
				<Grid item xs={6}><Button className={classes.btnCss} size='large'>Shop Collection</Button></Grid>
		</Grid>
}
export default MensDetails;
